function App() {

    const [avgList,avgSetList] = useState([])
    useEffect(()=>{
      const getNft = async ()=>{
        const sea = await axios.get('/assets?asset_contract_address=0x0ABf0FE202d52eDff1B9481A74543Ec01F00cc84')
        console.log(sea.data.assets)
        avgSetList(sea.data.assets)
      }
      return getNft();
    },[])

  return ( 
   <div className='app'>
      <Header />
      <CollectionCard id={0} name={'Flexxos'} traits={[{'value' : 7}]}
      image='https://ipfs.thirdweb.com/ipfs/QmfXghXspfqW7azqW3utvRM7CcDWjBVnhkQEFN4mLu8945/0.jpg'/>

     </div> 
    )
}

